                WriteLiteral(@"
    <script>
        const chargerTypeDropdown = document.getElementById(""chargerType"");
        const priceDropdown = document.getElementById(""priceDropdown"");
        const speedDropdown = document.getElementById(""speedDropdown"");

        function loadMeta(type) {
            fetch(`/Charger/GetChargerMeta?type=${type}`)
                .then(res => res.json())
                .then(meta => {
                    // Populate price dropdown
                    priceDropdown.innerHTML = """";
                    for (let p = meta.minPrice; p <= meta.maxPrice; p++) {
                        priceDropdown.innerHTML += `<option value=""${p}"">${p} ₹/kWh</option>`;
                    }

                    // Populate speed dropdown
                    speedDropdown.innerHTML = """";
                    for (let s = meta.minSpeed; s <= meta.maxSpeed; s += 5) {
                        speedDropdown.innerHTML += `<option value=""${s}"">${s} kW</option>`;
                    }
                });
   ");
                WriteLiteral("     }\r\n\r\n        chargerTypeDropdown.addEventListener(\"change\", e => loadMeta(e.target.value));\r\n        window.onload = () => loadMeta(chargerTypeDropdown.value);\r\n    </script>\r\n");
            }
            );
        }
